import React, { Fragment } from 'react'

const footer = () => {
    return (
        <Fragment>
            <footer className="py-1">
                <p className="text-center mt-1">
                    Eletronica Elisson - 2023, All Rights Reserved
                </p>
            </footer>
        </Fragment>
    )
}

export default footer
